import React from 'react';
import './Navbar.scss'

const Navbar = () => {
  return (
   <nav className="navbar">
    <div className="navbar__container">
      <a className="navbar__container__logo" href="/">
        <img className='navbar__container__logo__img' src="" alt="logo" />
        <span>Common</span>
      </a>
    </div>
  </nav>
  )
}

export default Navbar
